@MateuNicol La mente humana y sus trastornos; aquello intangible que nos hace tan diferentes de los demás animales. 

¿Somos el único animal capaz de crear una maquinaria suicida? 
Capaces de inventar el arma y de oprimir el gatillo para volarse los sesos.
